import React from 'react';
import '../App.css';
import { motion } from 'framer-motion';
import { slideIn } from "../";


const Stars = ({ starCount = 100 }) => {
    const stars = Array.from({ length: starCount }).map((_, index) => ({
        id: index,
        top: `${Math.random() * 100}%`,
        left: `${Math.random() * 100}%`,
        size: `${Math.random() * 6 + 1}px`, // Vary the star sizes between 1px and 4px
        animationDelay: `${Math.random() * 5}s`,
    }));

  return (
    <div className="fixed inset-0 overflow-hidden pointer-events-none">
        <section>
            <span></span>
            <span></span>
            <span></span>
            <span></span>
            <span></span>
            <span></span>

        </section>
      {stars.map((star) => (
        <div
          key={star.id}
          className="absolute bg-yellow-200 rounded-full animate-twinkle"
          style={{
            top: star.top,
            left: star.left,
            width: star.size,
            height: star.size,           
            animationDelay: star.animationDelay,
          }}
        />
      ))}
       <motion.div
        variants={slideIn("left", "tween", 0.2, 1)}
        className="bg-black-100 flex-[0.75] rounded-2xl p-8"
      ></motion.div>
    </div>

  );
};

export default Stars;
